<html lang="pl">
<head>
    <meta charset="UTF-8">
    <title>Czat ze SpierdaczkÄ… AI</title>
    <style>
        body {
            background: linear-gradient(45deg, #ff8a00, #e52e71, #2193b0, #6dd5ed);
            background-size: 400% 400%;
            animation: gradient 15s ease infinite;
            font-family: 'Comic Sans MS', cursive;
            margin: 0;
            padding: 0; /* Remove default padding */
            min-height: 100vh;
            overflow: hidden; /* Disable scrollbar */
            display: flex;
            flex-direction: column;
            align-items: center;
        }
    
        @keyframes gradient {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }
    
        @keyframes float {
            0% { transform: translate(0px, 0px) rotate(0deg) scale(1); }
            25% { transform: translate(10px, -10px) rotate(3deg) scale(1.05); }
            50% { transform: translate(-10px, 10px) rotate(-3deg) scale(1); }
            75% { transform: translate(10px, -10px) rotate(3deg) scale(1.05); }
            100% { transform: translate(0px, 0px) rotate(0deg) scale(1); }
        }


/* ResponsywnoÅ›Ä‡ */
@media screen and (max-width: 768px) {
    body {
        font-family: Arial, sans-serif; /* Zapobiega zmianie czcionki na dziwnÄ… kursywÄ™ */
    }

    .container {
        height: auto; /* PozwÃ³l rosnÄ…Ä‡ kontenerowi */
        margin-top: 10px;
        margin-bottom: 10px;
    }

    .input-container {
        flex-direction: column; /* Ustaw pola wejÅ›ciowe w kolumnie */
        gap: 5px; /* Mniejsza przerwa miÄ™dzy elementami */
    }

    .message-input {
        width: 100%; /* Dopasuj szerokoÅ›Ä‡ */
        font-size: 1rem;
        padding: 10px;
    }

    .send-button {
        width: 100%; /* Dopasuj przycisk do szerokoÅ›ci */
        border-radius: 10px; /* Zmniejsz zaokrÄ…glenie */
        height: auto;
        padding: 10px;
    }

    h1 {
        font-size: 2rem; /* Zmniejsz rozmiar nagÅ‚Ã³wka */
    }
}




        /* Styl scrollbara */
        .chat-container::-webkit-scrollbar {
            width: 12px; /* SzerokoÅ›Ä‡ scrollbara */
        }

        .chat-container::-webkit-scrollbar-track {
            background: rgba(255, 255, 255, 0.2); /* Kolor tÅ‚a tracka */
            border-radius: 10px; /* ZaokrÄ…glenie tracka */
        }

        .chat-container::-webkit-scrollbar-thumb {
            background: linear-gradient(45deg, #ff8a00, #e52e71); /* Kolor thumb-a */
            border-radius: 10px; /* ZaokrÄ…glenie thumb-a */
            border: 2px solid rgba(0, 0, 0, 0.1); /* Opcjonalne obramowanie */
        }

        .chat-container::-webkit-scrollbar-thumb:hover {
            background: linear-gradient(45deg, #e52e71, #2193b0); /* Zmiana koloru przy najechaniu */
        }

        .chat-container::-webkit-scrollbar-thumb:active {
            background: linear-gradient(45deg, #2193b0, #6dd5ed); /* Zmiana koloru przy klikniÄ™ciu */

        .container {
            background: rgba(255, 255, 255, 0.9);
            padding: 30px;
            border-radius: 20px;
            box-shadow: 0 0 20px rgba(0, 0, 0, 0.3);
            max-width: 800px;
            width: 90%;
            position: relative;
            z-index: 2;
            display: flex;
            flex-direction: column;
            height: 90vh;
            margin-top: auto; /* Automatically position the container */
            margin-bottom: 20px; /* Create space from the bottom */
        }

        h1 {
            text-align: center;
            color: #e52e71;
            font-size: 3em;
            text-shadow: 3px 3px 0px #ff8a00;
            margin-bottom: 30px;
        }

        .chat-container {
            flex-grow: 1;
            overflow-y: auto;
            margin-bottom: 20px;
            padding: 20px;
            display: flex;
            flex-direction: column;
            gap: 15px;
        }

        .message {
            max-width: 75%;
            padding: 10px 15px;
            border-radius: 15px;
            margin: 5px 0;
            word-wrap: break-word;
            white-space: pre-wrap;
        }

        .message-container {
            display: flex;
            align-items: flex-start; /* Align items to the top */
            margin: 5px 0; /* Added margin between messages */
         }

         .avatar {
            width: 40px; /* Slightly smaller */
            height: 40px;
            border-radius: 50%;
            object-fit: cover;
            margin-right: 10px;
            border: 2px solid #e52e71; /* Updated to match gradient */
        }

        .avatar.user {
            margin-left: 10px;
            margin-right: 0;
            border: 2px solid #2193b0; /* Another matching color for contrast */
            order: 2; /* Place user avatar to the right */
        }


        .user-message {
            background: #2193b0;
            color: white;
            align-self: flex-end;
            border-bottom-right-radius: 5px;
            order: 1;
        }

        .user-message-container {
          justify-content: flex-end; /* Align user messages to the right */
        }

        .ai-message {
            background: #e52e71;
            color: white;
            align-self: flex-start;
            border-bottom-left-radius: 5px;
        }

        .input-container {
            display: flex;
            gap: 10px;
            padding: 10px;
        }

        .message-input {
            flex-grow: 1;
            padding: 15px;
            border: 2px solid #6dd5ed;
            border-radius: 25px;
            font-size: 1em;
            outline: none;
            transition: all 0.3s ease;
        }

        .message-input:focus {
            border-color: #2193b0;
            box-shadow: 0 0 10px rgba(33, 147, 176, 0.3);
        }

        .send-button {
            background: linear-gradient(45deg, #ff8a00, #e52e71);
            border: none;
            border-radius: 50%;
            width: 50px;
            height: 50px;
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            transition: all 0.3s ease;
        }

        .send-button:hover {
            transform: scale(1.1);
        }

        .send-button svg {
            width: 24px;
            height: 24px;
            fill: white;
        }

        .lucek {
            position: fixed;
            width: 150px;
            height: 150px;
            animation: float 4s ease-in-out infinite;
        }
    
        #lucek1 { top: 10%; left: 5%; }
        #lucek2 { bottom: 10%; left: 5%; animation-delay: 1s; }
        #lucek3 { top: 10%; right: 5%; animation-delay: 2s; }
        #lucek4 { bottom: 10%; right: 5%; animation-delay: 3s; }

        .roderich {
            --roderich-size: 300px;
            --peek-rotation: 20deg;
            --peek-duration: 3s;
            --peek-timing: ease-in-out;
            --peek-distance: 120%;
            --x-position: 0px;
            --y-position: 60vh;
            
            position: fixed;
            width: var(--roderich-size);
            height: auto;
            pointer-events: none;
            z-index: 1;
            opacity: 0;
            object-fit: contain;
        }

        @keyframes peekabooLeft {
            0% { 
                transform: translate(calc(-100% - var(--x-position)), var(--y-position)) rotate(var(--peek-rotation));
                opacity: 0;
            }
            10% { 
                transform: translate(var(--x-position), var(--y-position)) rotate(var(--peek-rotation));
                opacity: 1;
            }
            90% { 
                transform: translate(var(--x-position), var(--y-position)) rotate(var(--peek-rotation));
                opacity: 1;
            }
            100% { 
                transform: translate(calc(-100% - var(--x-position)), var(--y-position)) rotate(var(--peek-rotation));
                opacity: 0;
            }
        }

        @keyframes peekabooRight {
            0% { 
                transform: translate(calc(100% + var(--x-position)), var(--y-position)) rotate(calc(-1 * var(--peek-rotation)));
                opacity: 0;
            }
            10% { 
                transform: translate(var(--x-position), var(--y-position)) rotate(calc(-1 * var(--peek-rotation)));
                opacity: 1;
            }
            90% { 
                transform: translate(var(--x-position), var(--y-position)) rotate(calc(-1 * var(--peek-rotation)));
                opacity: 1;
            }
            100% { 
                transform: translate(calc(100% + var(--x-position)), var(--y-position)) rotate(calc(-1 * var(--peek-rotation)));
                opacity: 0;
            }
        }
